INSERT INTO `blogs` VALUES (2,'Nội dung bài viết\n“Giải mã” sức hút của Sneaker đế mỏng\nTop 5 đôi giày đế mỏng giá rẻ hơn 2 triệu có mặt tại MaxxSport\nADIDAS VL COURT\nADIDAS BARREDA\nCOX SPORTIF BERCY SNEAKERS\nASICS JAPAN S\nNIKE COURT ROYALE','“REPLY 1990s” CÙNG XU HƯỚNG SNEAKER ĐẾ MỎNG','adidas','S1',_binary 'data:image/png;base64,','Quay vòng thời trang, giày thể thao đế mỏng đã trở thành xu hướng lớn trong thị trường thời trang trong khoảng 2 năm qua, chủ yếu nhờ vào sự kết hợp giữa sự thoải mái và phong cách hiện đại.\n\n\n\n“Giải mã” sức hút của Sneaker đế mỏng\n“Simple is the best!”: Đơn giản, tinh tế, nhưng không kém phần nổi bật là những gì khiến người ta phát cuồng với dòng giày này. Khoác lên mình một thiết kế thanh lịch với những gam màu tối giản, những “tượng đài” như adidas Samba hay Onitsuka Tiger Mexico 66 vẫn sẵn sàng chinh phục mọi phong cách ăn mặc, từ casual cho tới formal.\n\nLợi ích cho sức khỏe: Đế mỏng giúp tạo sự liên kết trực tiếp giữa bàn chân và mặt đất, mang lại cảm giác nhẹ nhàng, giúp người mang dễ dàng di chuyển, giúp cải thiện cảm giác thăng bằng và phản ứng nhanh nhạy hơn trong các hoạt động thể thao hoặc đi bộ dài.\n\nSự “chiều chuộng” của các ông lớn: Bạn phải mất tới cả ngày để có thể kể cho hết tên những mẫu giày “cháy hàng” của dòng Sneaker đế mỏng - vì đơn giản là mọi nhà mốt mà bạn biết như ADIDAS, Nike, Puma, ASICS, le coq sportif,... đều đã và đang cho ra vô vàn những mẫu thiết kế để đáp ứng cho mọi tín đồ thời trang và streetwear.\n\nTop 5 đôi giày đế mỏng giá rẻ hơn 2 triệu có mặt tại MaxxSport\nADIDAS VL COURT\nADIDAS VL Court là một mẫu giày thể thao mang phong cách retro của ADIDAS, nổi bật với thiết kế đơn giản và thoải mái.\n\nadidas 愛迪達】 VL COURT 休閒鞋運動休閒鞋男鞋/女鞋JH5061 | 休閒鞋| Yahoo奇摩購物中心\n\nGiá niêm yết VL Court tại MaxxSport: 1.200.000đ - 1.700.000đ\n\nADIDAS VL Court chinh phục người dùng với thiết kế tối giản: 3 đường kẻ signature của nhà adidad cùng logo nhỏ bên hông, tạo nên vẻ ngoài tinh tế, thanh lịch, dễ dàng phối đồ cùng nhiều phong cách khác nhau.\n\nADIDAS BARREDA\nADIDAS Barreda là một mẫu giày thể thao mang phong cách đơn giản nhưng hiện đại của ADIDAS. Được thiết kế với chất liệu bền bỉ, giày Barreda không chỉ đảm bảo sự thoải mái mà còn hỗ trợ tối đa trong các hoạt động thể thao. Phần đế giày được cải tiến với công nghệ tối ưu, giúp tăng cường độ bám và sự linh hoạt trong từng bước đi.\n\nBARREDA 運動鞋- 白色| 男子| adidas(愛迪達)香港官方網上商店\n\nGiá niêm yết adidas Barreda tại MaxxSport: 1.500.000đ - 2.000.000đ\n\nTuy không phổ biến như những dòng giày nổi tiếng khác của hãng, Barreda vẫn thu hút người dùng nhờ vào thiết kế sạch sẽ, nhẹ nhàng và dễ dàng kết hợp với nhiều trang phục.\n\nCOX SPORTIF BERCY SNEAKERS \nMang một vibe thanh lịch , đôi sneaker của le coq sportif sẽ cực kỳ với những outfit đa di năng để đi làm, đi học, đi dạo phố.\n\nGiày thời trang le coq sportif Nam QL1XJC08WN\n\nGiá của Bercy Sneakers tại MaxxSport: 1.600.000đ - 1.700.000đ\n\nĐế giữa được làm bằng EVA nén và có các khe uốn dẻo dưới đế giày, tạo ra một thiết kế độc đáo, kết hợp giữa vẻ ngoài cổ điển và tính năng đệm êm ái. Không chỉ mang lại cảm giác thoải mái khi mang, mà còn có thiết kế sạch sẽ phù hợp với nhiều phong cách trang phục khác nhau.\n\nASICS JAPAN S\nASICS Japan S là một mẫu giày thể thao thuộc dòng cổ điển của ASICS, mang đậm ảnh hưởng từ các thiết kế thể thao những năm 80. Japan S sở hữu phần thân giày được làm từ da cao cấp kết hợp với chất liệu vải lưới cùng công nghệ giảm chấn GEL ở phần đế giày, giúp tăng cường sự thoải mái và độ bền bỉ.\n\nMen\'s shoes Asics Japan S White/ Black | Footshop\n\nGiá của asics Japan S tại MaxxSport: 1.300.000đ - 1.800.000đ\n\nThiết kế thanh lịch kết hợp công nghệ đặc biệt, ASICS Japan S thích hợp cho cả hoạt động thể thao lẫn trang phục thường ngày.\n\nNIKE COURT ROYALE\nNike Court Royale là một mẫu giày thể thao được lấy cảm hứng từ phong cách cổ điển của những đôi giày tennis. Đế giày bằng cao su có độ bám cao, giúp bạn di chuyển linh hoạt và tự tin.\n\nGiày Nike Court Royale AC \'White Black\' BQ4222-103 - Jordan 1\n\nGiá của Nike Court Royale tại MaxxSport: 1.000.000đ - 1.700.000đ\n\nNike Court Royale là lựa chọn hoàn hảo cho những ai yêu thích sự thanh lịch, tối giản nhưng không kém phần thời trang, phù hợp cho cả phong cách thể thao và streetwear.\n\nTham khảo các mẫu sneaker khác tại MaxxSport: maxxsport.com.vn/bst-giay-dep','<p>Quay vòng thời trang, giày thể thao đế mỏng đã trở thành xu hướng lớn trong thị trường thời trang trong khoảng 2 năm qua, chủ yếu nhờ vào sự kết hợp giữa sự thoải mái và phong cách hiện đại.</p>\n<p>“Giải mã” sức hút của Sneaker đế mỏng\n“Simple is the best!”: Đơn giản, tinh tế, nhưng không kém phần nổi bật là những gì khiến người ta phát cuồng với dòng giày này. Khoác lên mình một thiết kế thanh lịch với những gam màu tối giản, những “tượng đài” như adidas Samba hay Onitsuka Tiger Mexico 66 vẫn sẵn sàng chinh phục mọi phong cách ăn mặc, từ casual cho tới formal.</p>\n<p>Lợi ích cho sức khỏe: Đế mỏng giúp tạo sự liên kết trực tiếp giữa bàn chân và mặt đất, mang lại cảm giác nhẹ nhàng, giúp người mang dễ dàng di chuyển, giúp cải thiện cảm giác thăng bằng và phản ứng nhanh nhạy hơn trong các hoạt động thể thao hoặc đi bộ dài.</p>\n<p>Sự “chiều chuộng” của các ông lớn: Bạn phải mất tới cả ngày để có thể kể cho hết tên những mẫu giày “cháy hàng” của dòng Sneaker đế mỏng - vì đơn giản là mọi nhà mốt mà bạn biết như ADIDAS, Nike, Puma, ASICS, le coq sportif,... đều đã và đang cho ra vô vàn những mẫu thiết kế để đáp ứng cho mọi tín đồ thời trang và streetwear.</p>\n<p>Top 5 đôi giày đế mỏng giá rẻ hơn 2 triệu có mặt tại MaxxSport\nADIDAS VL COURT\nADIDAS VL Court là một mẫu giày thể thao mang phong cách retro của ADIDAS, nổi bật với thiết kế đơn giản và thoải mái.</p>\n<p>adidas 愛迪達】 VL COURT 休閒鞋運動休閒鞋男鞋/女鞋JH5061 | 休閒鞋| Yahoo奇摩購物中心</p>\n<p>Giá niêm yết VL Court tại MaxxSport: 1.200.000đ - 1.700.000đ</p>\n<p>ADIDAS VL Court chinh phục người dùng với thiết kế tối giản: 3 đường kẻ signature của nhà adidad cùng logo nhỏ bên hông, tạo nên vẻ ngoài tinh tế, thanh lịch, dễ dàng phối đồ cùng nhiều phong cách khác nhau.</p>\n<p>ADIDAS BARREDA\nADIDAS Barreda là một mẫu giày thể thao mang phong cách đơn giản nhưng hiện đại của ADIDAS. Được thiết kế với chất liệu bền bỉ, giày Barreda không chỉ đảm bảo sự thoải mái mà còn hỗ trợ tối đa trong các hoạt động thể thao. Phần đế giày được cải tiến với công nghệ tối ưu, giúp tăng cường độ bám và sự linh hoạt trong từng bước đi.</p>\n<p>BARREDA 運動鞋- 白色| 男子| adidas(愛迪達)香港官方網上商店</p>\n<p>Giá niêm yết adidas Barreda tại MaxxSport: 1.500.000đ - 2.000.000đ</p>\n<p>Tuy không phổ biến như những dòng giày nổi tiếng khác của hãng, Barreda vẫn thu hút người dùng nhờ vào thiết kế sạch sẽ, nhẹ nhàng và dễ dàng kết hợp với nhiều trang phục.</p>\n<p>COX SPORTIF BERCY SNEAKERS\nMang một vibe thanh lịch , đôi sneaker của le coq sportif sẽ cực kỳ với những outfit đa di năng để đi làm, đi học, đi dạo phố.</p>\n<p>Giày thời trang le coq sportif Nam QL1XJC08WN</p>\n<p>Giá của Bercy Sneakers tại MaxxSport: 1.600.000đ - 1.700.000đ</p>\n<p>Đế giữa được làm bằng EVA nén và có các khe uốn dẻo dưới đế giày, tạo ra một thiết kế độc đáo, kết hợp giữa vẻ ngoài cổ điển và tính năng đệm êm ái. Không chỉ mang lại cảm giác thoải mái khi mang, mà còn có thiết kế sạch sẽ phù hợp với nhiều phong cách trang phục khác nhau.</p>\n<p>ASICS JAPAN S\nASICS Japan S là một mẫu giày thể thao thuộc dòng cổ điển của ASICS, mang đậm ảnh hưởng từ các thiết kế thể thao những năm 80. Japan S sở hữu phần thân giày được làm từ da cao cấp kết hợp với chất liệu vải lưới cùng công nghệ giảm chấn GEL ở phần đế giày, giúp tăng cường sự thoải mái và độ bền bỉ.</p>\n<p>Men\'s shoes Asics Japan S White/ Black | Footshop</p>\n<p>Giá của asics Japan S tại MaxxSport: 1.300.000đ - 1.800.000đ</p>\n<p>Thiết kế thanh lịch kết hợp công nghệ đặc biệt, ASICS Japan S thích hợp cho cả hoạt động thể thao lẫn trang phục thường ngày.</p>\n<p>NIKE COURT ROYALE\nNike Court Royale là một mẫu giày thể thao được lấy cảm hứng từ phong cách cổ điển của những đôi giày tennis. Đế giày bằng cao su có độ bám cao, giúp bạn di chuyển linh hoạt và tự tin.</p>\n<p>Giày Nike Court Royale AC \'White Black\' BQ4222-103 - Jordan 1</p>\n<p>Giá của Nike Court Royale tại MaxxSport: 1.000.000đ - 1.700.000đ</p>\n<p>Nike Court Royale là lựa chọn hoàn hảo cho những ai yêu thích sự thanh lịch, tối giản nhưng không kém phần thời trang, phù hợp cho cả phong cách thể thao và streetwear.</p>\n<p>Tham khảo các mẫu sneaker khác tại MaxxSport: maxxsport.com.vn/bst-giay-dep</p>\n',27,0,'2025-05-12 16:51:42','2025-05-12 16:51:42'),(3,'Tham gia ngay minigame với 3 bước đơn giản sau để có cơ hội rinh những items thể thao cực chất của MaxxSport nhé!\n\n1️⃣ Like và share bài viết này về Facebook cá nhân ở chế độ công khai\n2️⃣ Chụp ảnh check in cùng thiệp / quà tặng (tất) / màn hình lời chúc Giáng sinh tại các cửa hàng MaxxSport trên toàn quốc\n3️⃣ Đăng hình ảnh trên trang Facebook cá nhân ở chế độ công khai kèm hashtag #merrychristmaxx #maxxsport #giangsinhcungmaxxsport','[MINIGAME] POSE DÁNG XINH - NHẬN QUÀ ĐỈNH','adidas','S1',_binary 'data:image/jpeg;base64,','MaxxSport sẽ chọn ra 5 người chơi có bài đăng sở hữu lượt tương tác cao nhất sẽ nhận được các phần quà sau, thông qua trang tìm kiếm hashtag #giangsinhcungmaxxsport trên nền tảng Facebook\n\n️?️01 GIẢI NHẤT: 01 đôi giày ADIDAS trị giá tới 2.700.000Đ\n\n?️01 GIẢI NHÌ: 01 đôi giày Li-Ning trị giá tới 1.700.000Đ\n\n?03 GIẢI BA: 01 phụ kiện Li-Ning hoặc 361º Sport trị giá tới 700.000Đ\n\n? Thời gian tham gia: 17.12 - 16h ngày 26.12.2024\n\n \n\nCÁCH TÍNH ĐIỂM:\n\nĐiểm tương tác được tính bằng tổng các reaction, comment, share với thang điểm:\n\n?1 share = 5 điểm\n\n?1 reaction (like/tim...) = 3 điểm\n\n?1 comment = 1 điểm\n\n \n\nĐIỀU KIỆN DỰ THI HỢP LỆ:\n\n- Bài dự thi được đăng tải ở chế độ công khai trong suốt thời gian tham gia chương trình, có gắn đầy đủ các hashtag.\n\n- Hình ảnh trong bài đăng dự thi có xuất hiện Thiệp Giáng sinh, Quà tặng Giáng sinh hoặc các lời chúc Giáng sinh của MaxxSport.\n\n- Mỗi tài khoản chỉ được đăng 1 bài dự thi duy nhất. Trường hợp có hơn 1 bài đăng dự thi, kết quả sẽ được tính cho bài đăng sớm hơn.\n\n- Không sử dụng bất kỳ hình thức hoặc công cụ hỗ trợ tăng tương tác nào. BTC có quyền huỷ bỏ kết quả nếu nghi ngờ hoặc phát hiện các hành vi gian lận.\n\n \n\n⚠️ LƯU Ý QUAN TRỌNG ⚠️\n\n- Quà tặng sẽ được chọn dựa trên tồn kho thực tế tại thời điểm công bố kết quả.\n\n- Trường hợp có nhiều hơn 1 bài đăng có cùng số lượng tương tác, kết quả sẽ được ghi nhận cho bài đăng có số lượt chia sẻ nhiều hơn. Trường hợp có cùng số lượt chia sẻ, kết quả sẽ được tính cho bài đăng sớm hơn.\n\n- Những bài đăng sau 16:00 ngày 26.12.2024 sẽ được tính là không hợp lệ.\n\n- Nếu có tranh chấp xảy ra, quyết định của MaxxSport/BTC là quyết định cuối cùng.\n\n- Công bố kết quả muộn nhất ngày 08.01.2024.','<p>MaxxSport sẽ chọn ra 5 người chơi có bài đăng sở hữu lượt tương tác cao nhất sẽ nhận được các phần quà sau, thông qua trang tìm kiếm hashtag #giangsinhcungmaxxsport trên nền tảng Facebook</p>\n<p>️?️01 GIẢI NHẤT: 01 đôi giày ADIDAS trị giá tới 2.700.000Đ</p>\n<p>?️01 GIẢI NHÌ: 01 đôi giày Li-Ning trị giá tới 1.700.000Đ</p>\n<p>?03 GIẢI BA: 01 phụ kiện Li-Ning hoặc 361º Sport trị giá tới 700.000Đ</p>\n<p>? Thời gian tham gia: 17.12 - 16h ngày 26.12.2024</p>\n<p>CÁCH TÍNH ĐIỂM:</p>\n<p>Điểm tương tác được tính bằng tổng các reaction, comment, share với thang điểm:</p>\n<p>?1 share = 5 điểm</p>\n<p>?1 reaction (like/tim...) = 3 điểm</p>\n<p>?1 comment = 1 điểm</p>\n<p>ĐIỀU KIỆN DỰ THI HỢP LỆ:</p>\n<ul>\n<li>\n<p>Bài dự thi được đăng tải ở chế độ công khai trong suốt thời gian tham gia chương trình, có gắn đầy đủ các hashtag.</p>\n</li>\n<li>\n<p>Hình ảnh trong bài đăng dự thi có xuất hiện Thiệp Giáng sinh, Quà tặng Giáng sinh hoặc các lời chúc Giáng sinh của MaxxSport.</p>\n</li>\n<li>\n<p>Mỗi tài khoản chỉ được đăng 1 bài dự thi duy nhất. Trường hợp có hơn 1 bài đăng dự thi, kết quả sẽ được tính cho bài đăng sớm hơn.</p>\n</li>\n<li>\n<p>Không sử dụng bất kỳ hình thức hoặc công cụ hỗ trợ tăng tương tác nào. BTC có quyền huỷ bỏ kết quả nếu nghi ngờ hoặc phát hiện các hành vi gian lận.</p>\n</li>\n</ul>\n<p>⚠️ LƯU Ý QUAN TRỌNG ⚠️</p>\n<ul>\n<li>\n<p>Quà tặng sẽ được chọn dựa trên tồn kho thực tế tại thời điểm công bố kết quả.</p>\n</li>\n<li>\n<p>Trường hợp có nhiều hơn 1 bài đăng có cùng số lượng tương tác, kết quả sẽ được ghi nhận cho bài đăng có số lượt chia sẻ nhiều hơn. Trường hợp có cùng số lượt chia sẻ, kết quả sẽ được tính cho bài đăng sớm hơn.</p>\n</li>\n<li>\n<p>Những bài đăng sau 16:00 ngày 26.12.2024 sẽ được tính là không hợp lệ.</p>\n</li>\n<li>\n<p>Nếu có tranh chấp xảy ra, quyết định của MaxxSport/BTC là quyết định cuối cùng.</p>\n</li>\n<li>\n<p>Công bố kết quả muộn nhất ngày 08.01.2024.</p>\n</li>\n</ul>\n',27,2,'2025-05-12 16:53:59','2025-05-28 09:09:28'),(4,'From the court to the street, for decades adidas iconic performance driven designs have transcended the sporting sphere – becoming a part of lifestyle moodboards the world over. Today, Sporty & Rich and adidas Originals have reignited their partnership to celebrate the enduring legacy of off-court tennis aesthetics with a timeless apparel, accessories, and footwear collection.','adidas Originals and Sporty & Rich Celebrate Court Nostalgia with their Latest Collection','adidas','S1',_binary 'data:image/jpeg;base64,','From the court to the street, for decades adidas iconic performance driven designs have transcended the sporting sphere – becoming a part of lifestyle moodboards the world over. Today, Sporty & Rich and adidas Originals have reignited their partnership to celebrate the enduring legacy of off-court tennis aesthetics with a timeless apparel, accessories, and footwear collection.\n\nCelebrating classic court style, the Emily Oberg led brand brings its distinct sensibility to two signature adidas silhouettes from different sporting eras: the 2000s inspired ADIZERO ADIOS and the adidas Originals Blanc, reimagined from the 70s.\n\nFeaturing a two tone mesh upper, gradient three stripes, an ADIPRENE outsole, and subtle branded details, the ADIZERO ADIOS Sporty & Rich arrives in two classic colorways: green and midnight navy.\n\nThe adidas Originals Blanc Sporty & Rich sneaker, meanwhile, is made up in two inverted constructions: one in white leather with green suede stripes and one in green suede with white leather stripes. Both of the retro looks are then finished with tennis racket lace charms and co-branded details.\n\nSimilarly, the apparel offering plays host to a number of court inspired pieces: from a polo, graphic tee, and a tank, to shorts and skorts, and a heavy knit sweater. The collection is then completed with a classic canvas bag and accompanying caps.\n\nThe latest adidas Originals and Sporty & Rich collection launches on May 30th on sportyandrich.com and is available on May 30th via CONFIRMED, adidas.com, selected adidas and adidas Originals stores, and select retailers.','<p>From the court to the street, for decades adidas iconic performance driven designs have transcended the sporting sphere – becoming a part of lifestyle moodboards the world over. Today, Sporty &amp; Rich and adidas Originals have reignited their partnership to celebrate the enduring legacy of off-court tennis aesthetics with a timeless apparel, accessories, and footwear collection.</p>\n<p>Celebrating classic court style, the Emily Oberg led brand brings its distinct sensibility to two signature adidas silhouettes from different sporting eras: the 2000s inspired ADIZERO ADIOS and the adidas Originals Blanc, reimagined from the 70s.</p>\n<p>Featuring a two tone mesh upper, gradient three stripes, an ADIPRENE outsole, and subtle branded details, the ADIZERO ADIOS Sporty &amp; Rich arrives in two classic colorways: green and midnight navy.</p>\n<p>The adidas Originals Blanc Sporty &amp; Rich sneaker, meanwhile, is made up in two inverted constructions: one in white leather with green suede stripes and one in green suede with white leather stripes. Both of the retro looks are then finished with tennis racket lace charms and co-branded details.</p>\n<p>Similarly, the apparel offering plays host to a number of court inspired pieces: from a polo, graphic tee, and a tank, to shorts and skorts, and a heavy knit sweater. The collection is then completed with a classic canvas bag and accompanying caps.</p>\n<p>The latest adidas Originals and Sporty &amp; Rich collection launches on May 30th on sportyandrich.com and is available on May 30th via CONFIRMED, adidas.com, selected adidas and adidas Originals stores, and select retailers.</p>\n',27,0,'2025-05-28 09:03:03','2025-05-28 09:03:03');
INSERT INTO `blogs` VALUES (5,'Analog explorer meets digital world. Fresh off the back of their highly coveted second collaborative collection last year, adidas Originals and 100 Thieves return to present their Spring/Summer 2025 collection.','adidas Originals and 100 Thieves Unveil Third Collaborative Collection featuring Gold Medalist and Gamer Noah Lyles','adidas','S1',_binary 'data:image/jpeg;base64,','Analog explorer meets digital world. Fresh off the back of their highly coveted second collaborative collection last year, adidas Originals and 100 Thieves return to present their Spring/Summer 2025 collection.\n\nSeeking to bridge the gap between gaming and the outdoors, while simultaneously drawing on the aesthetics and stylistic sensibilities of RPGs (role-playing game), the third collaborative collection redefines what it means to explore in 2025, whether logged in or logged off.\n\nThe collection is brought to life with the world champion sprinter Noah Lyles. Noah is a passionate gamer and 100 Thieves supporter, perfectly representing the crossover between sports and esports. Noah being the face of the new adidas Originals x 100 Thieves drop highlights the growing relevance of Gaming in entertainment and lifestyle, underscoring how top athletes now proudly embrace their identity as gamers as well.\n\nFusing outdoor inspired design with everyday indoor comfort, the custom collection has been developed to help the wearer navigate real and virtual open worlds.\n\nThe apparel selection features the 100T Zip Pant with cargo style pockets for extra functionality, the 100T technical T-shirt with a custom co-branded graphic on the front, the cozy 100T QLT Liner with quilted stitch details, and the GeoPrint embroidered 100T Hoodie.\n\nThe highly functional and adaptable 100T Bag and 5-panel 100T Cap are then accompanied by a three pack of co-branded 100T Socks to round out the accessories offering.\n\nA trio of bold silhouettes then make up the collection’s dynamic footwear selection. First, the collaborative 100T Palos Hills sneaker, a silhouette that was first co-created by adidas Originals and 100T in Fall/Winter 2024 returns with considerable updates, this time in water resistant gray nylon with durable textured rubber toe and heel caps. Next, the 100T Savage takes an early 00’s silhouette and updates it with modern tech materials, reflective details, and a signature 100 Thieves tonal black with alternating red and blue pops, while the 100T Adilette brings a striking logoed update to the ultimate comfort slide.\n\nThe collection launches on May 14th on 100thieves.com, adidas.com, CONFIRMED,  adidas stores and via select retailers.\n\nAbout adidas Originals\n\nInspired by the rich sporting heritage of adidas - one of the world’s leading sports brands and a global designer and developer of athletic footwear and apparel - adidas Originals is a lifestyle brand founded in 2001. With the adidas archive at its foundation, adidas Originals continues to evolve the brand’s legacy through its commitment to product innovation and its ability to filter the creativity and courage found on the courts and sporting arenas through the lens of contemporary youth culture. Marked by the iconic Trefoil logo that was first used in 1972 and championed by those that continue to shape and define creative culture, adidas Originals continues to lead the way as the pioneering sportswear brand for the street.\n\nAbout 100 Thieves\n\n100 Thieves (“Hundred Thieves”) is the premier gaming-focused lifestyle brand based in Los Angeles, founded in 2017 by Matthew \"Nadeshot\" Haag. The brand encompasses championship esports teams, a groundbreaking apparel brand, and captivating content created by world-class gaming and entertainment creators. With a global fanbase exceeding 100 million, 100 Thieves is one of the fastest-growing brands in entertainment, committed to redefining the boundaries of gaming and pop-culture. 100 Thieves envisions a future where gaming is a unifying force that fosters a sense of community and pride for all participants. The brand is dedicated to promoting excellence, innovation, and inclusivity within the gaming community, inspiring people to reach their full potential and feel valued and respected. 100 Thieves exists to empower every gamer and give them something to be proud of.','<p>Analog explorer meets digital world. Fresh off the back of their highly coveted second collaborative collection last year, adidas Originals and 100 Thieves return to present their Spring/Summer 2025 collection.</p>\n<p>Seeking to bridge the gap between gaming and the outdoors, while simultaneously drawing on the aesthetics and stylistic sensibilities of RPGs (role-playing game), the third collaborative collection redefines what it means to explore in 2025, whether logged in or logged off.</p>\n<p>The collection is brought to life with the world champion sprinter Noah Lyles. Noah is a passionate gamer and 100 Thieves supporter, perfectly representing the crossover between sports and esports. Noah being the face of the new adidas Originals x 100 Thieves drop highlights the growing relevance of Gaming in entertainment and lifestyle, underscoring how top athletes now proudly embrace their identity as gamers as well.</p>\n<p>Fusing outdoor inspired design with everyday indoor comfort, the custom collection has been developed to help the wearer navigate real and virtual open worlds.</p>\n<p>The apparel selection features the 100T Zip Pant with cargo style pockets for extra functionality, the 100T technical T-shirt with a custom co-branded graphic on the front, the cozy 100T QLT Liner with quilted stitch details, and the GeoPrint embroidered 100T Hoodie.</p>\n<p>The highly functional and adaptable 100T Bag and 5-panel 100T Cap are then accompanied by a three pack of co-branded 100T Socks to round out the accessories offering.</p>\n<p>A trio of bold silhouettes then make up the collection’s dynamic footwear selection. First, the collaborative 100T Palos Hills sneaker, a silhouette that was first co-created by adidas Originals and 100T in Fall/Winter 2024 returns with considerable updates, this time in water resistant gray nylon with durable textured rubber toe and heel caps. Next, the 100T Savage takes an early 00’s silhouette and updates it with modern tech materials, reflective details, and a signature 100 Thieves tonal black with alternating red and blue pops, while the 100T Adilette brings a striking logoed update to the ultimate comfort slide.</p>\n<p>The collection launches on May 14th on 100thieves.com, adidas.com, CONFIRMED,  adidas stores and via select retailers.</p>\n<p>About adidas Originals</p>\n<p>Inspired by the rich sporting heritage of adidas - one of the world’s leading sports brands and a global designer and developer of athletic footwear and apparel - adidas Originals is a lifestyle brand founded in 2001. With the adidas archive at its foundation, adidas Originals continues to evolve the brand’s legacy through its commitment to product innovation and its ability to filter the creativity and courage found on the courts and sporting arenas through the lens of contemporary youth culture. Marked by the iconic Trefoil logo that was first used in 1972 and championed by those that continue to shape and define creative culture, adidas Originals continues to lead the way as the pioneering sportswear brand for the street.</p>\n<p>About 100 Thieves</p>\n<p>100 Thieves (“Hundred Thieves”) is the premier gaming-focused lifestyle brand based in Los Angeles, founded in 2017 by Matthew &quot;Nadeshot&quot; Haag. The brand encompasses championship esports teams, a groundbreaking apparel brand, and captivating content created by world-class gaming and entertainment creators. With a global fanbase exceeding 100 million, 100 Thieves is one of the fastest-growing brands in entertainment, committed to redefining the boundaries of gaming and pop-culture. 100 Thieves envisions a future where gaming is a unifying force that fosters a sense of community and pride for all participants. The brand is dedicated to promoting excellence, innovation, and inclusivity within the gaming community, inspiring people to reach their full potential and feel valued and respected. 100 Thieves exists to empower every gamer and give them something to be proud of.</p>\n',27,0,'2025-05-28 09:03:43','2025-05-28 09:03:43'),(6,'Inspired by the natural surroundings of Miami, the collection features an all-over black graphic of a mangrove tree leaf – a species of shrub native to the region – set against a striking burgundy and coral base\nThe collection includes a hero driver’s jersey, and also offers a dedicated range for fans, which includes loungewear, a jacket, t-shirts, adilettes, shorts and accessories\nAvailable to purchase from 28 April 2025, fans can buy the adidas x Mercedes-AMG PETRONAS F1 Summer collection via adidas wholesale accounts and adidas.com/motorsport.','adidas & Mercedes-AMG PETRONAS F1 Team Launch First Race Specific Collection with All-New Summer Pack','adidas','S1',_binary 'data:image/jpeg;base64,','Today, adidas and Mercedes-AMG PETRONAS F1 Team unveil the new summer collection. Designed to bring a summertime feel to the paddock in Miami, while remaining true to the performance and excellence credentials the partnership is forged on, the collection takes its inspiration from Miami’s iconic mangroves - the natural roots of the city – celebrating its beauty and delivering a look to match the vibrant energy of The 305.\n\nCrafted to stand out in both the pit lane and the stands, adidas’ designers took inspiration from the mangrove tree, a key shrub rooted in the foundation of the city and one that frequents the landscape and the surrounding region – expressed through a contemporary black graphic of its leaves which is featured throughout the collection. Most notably, the drivers\' jersey sees the graphic contrasted against an off-white, burgundy and coral base – complemented by three white stripes on each shoulder and the adidas logo on the sternum. \n\nThis blend of Miami glamour and sports performance functionality can be seen across apparel and accessories throughout the fanwear collection – including loungewear, a jacket, t-shirts, adilettes, shorts and accessories; each designed to help fans show support for the team and help unite the community.\n\nMichael Batz, Motorsport Category GM at adidas said: “Miami is one of the most anticipated races on the calendar, a city known for both sport and style, making it the ideal location to debut the first adidas x Mercedes-AMG PETRONAS F1 race day collection for Summer 2025. For this collection, we wanted to capture the essence of Miami in a fresh and unexpected way, brought to life with bold hues and prints which bring a vibrant splash of Miami style to the F1 paddock this May.”\n\nRichard Sanders, Chief Commercial Officer at Mercedes-AMG PETRONAS F1 Team, said: \"Our partnership with adidas is built on bringing a fresh perspective to our sport and the F1 fanbase. Our first race-specific collection delivers on that with its bold design that celebrates the natural roots of Miami. Dropping our summer collection at a race that symbolizes so much about how our sport and team has grown and reached new audiences in recent years feels appropriate. We can\'t wait to see the fans in the grandstands, and those watching around the world, showing their support in the vibrant colors of the summer pack.\"\n\nAhead of the race in Miami, the adidas x Mercedes-AMG PETRONAS F1 Summer collection is available to purchase from 28 April 2025 from a section of adidas wholesale accounts and adidas.com/motorsport.\n\nAbout adidas\n\nadidas is a global leader in the sporting goods industry. Headquartered in Herzogenaurach/Germany, the company employs more than 62,000 people across the globe and generated sales of € 23.7 billion in 2024.\n\nAbout the Mercedes-AMG PETRONAS F1 Team\n\nMercedes was born to race - and we\'ve been doing it since 1901. Today, the Mercedes-AMG PETRONAS F1 Team competes at the pinnacle of motorsport: the FIA Formula One World Championship.\n\nThe pioneering spirit of our company founders lives on in our commitment to innovation and performance. As the world\'s original automobile manufacturer, Mercedes-Benz has defined the cutting edge of technology for over a century. Today, our F1 team exists to demonstrate the best of the brand\'s performance on the global stage.\n\nBased in Brackley and Brixworth, UK, over 2,000 committed team members work with a singular mission: to win the world championship. From 2014 to 2021, we secured a record eight consecutive Constructors\' Championships, and we are hungry for more.\n\nOur journey is not just about performance on the track; we also strive to make a positive impact on the world and inspire future generations. We are proud signatories of the Climate Pledge, and we are leading the way in building a more sustainable and inclusive sport.','<p>Today, adidas and Mercedes-AMG PETRONAS F1 Team unveil the new summer collection. Designed to bring a summertime feel to the paddock in Miami, while remaining true to the performance and excellence credentials the partnership is forged on, the collection takes its inspiration from Miami’s iconic mangroves - the natural roots of the city – celebrating its beauty and delivering a look to match the vibrant energy of The 305.</p>\n<p>Crafted to stand out in both the pit lane and the stands, adidas’ designers took inspiration from the mangrove tree, a key shrub rooted in the foundation of the city and one that frequents the landscape and the surrounding region – expressed through a contemporary black graphic of its leaves which is featured throughout the collection. Most notably, the drivers\' jersey sees the graphic contrasted against an off-white, burgundy and coral base – complemented by three white stripes on each shoulder and the adidas logo on the sternum.</p>\n<p>This blend of Miami glamour and sports performance functionality can be seen across apparel and accessories throughout the fanwear collection – including loungewear, a jacket, t-shirts, adilettes, shorts and accessories; each designed to help fans show support for the team and help unite the community.</p>\n<p>Michael Batz, Motorsport Category GM at adidas said: “Miami is one of the most anticipated races on the calendar, a city known for both sport and style, making it the ideal location to debut the first adidas x Mercedes-AMG PETRONAS F1 race day collection for Summer 2025. For this collection, we wanted to capture the essence of Miami in a fresh and unexpected way, brought to life with bold hues and prints which bring a vibrant splash of Miami style to the F1 paddock this May.”</p>\n<p>Richard Sanders, Chief Commercial Officer at Mercedes-AMG PETRONAS F1 Team, said: &quot;Our partnership with adidas is built on bringing a fresh perspective to our sport and the F1 fanbase. Our first race-specific collection delivers on that with its bold design that celebrates the natural roots of Miami. Dropping our summer collection at a race that symbolizes so much about how our sport and team has grown and reached new audiences in recent years feels appropriate. We can\'t wait to see the fans in the grandstands, and those watching around the world, showing their support in the vibrant colors of the summer pack.&quot;</p>\n<p>Ahead of the race in Miami, the adidas x Mercedes-AMG PETRONAS F1 Summer collection is available to purchase from 28 April 2025 from a section of adidas wholesale accounts and adidas.com/motorsport.</p>\n<p>About adidas</p>\n<p>adidas is a global leader in the sporting goods industry. Headquartered in Herzogenaurach/Germany, the company employs more than 62,000 people across the globe and generated sales of € 23.7 billion in 2024.</p>\n<p>About the Mercedes-AMG PETRONAS F1 Team</p>\n<p>Mercedes was born to race - and we\'ve been doing it since 1901. Today, the Mercedes-AMG PETRONAS F1 Team competes at the pinnacle of motorsport: the FIA Formula One World Championship.</p>\n<p>The pioneering spirit of our company founders lives on in our commitment to innovation and performance. As the world\'s original automobile manufacturer, Mercedes-Benz has defined the cutting edge of technology for over a century. Today, our F1 team exists to demonstrate the best of the brand\'s performance on the global stage.</p>\n<p>Based in Brackley and Brixworth, UK, over 2,000 committed team members work with a singular mission: to win the world championship. From 2014 to 2021, we secured a record eight consecutive Constructors\' Championships, and we are hungry for more.</p>\n<p>Our journey is not just about performance on the track; we also strive to make a positive impact on the world and inspire future generations. We are proud signatories of the Climate Pledge, and we are leading the way in building a more sustainable and inclusive sport.</p>\n',27,0,'2025-05-28 09:05:09','2025-05-28 09:05:09'),(7,'Today, adidas launches the new F50 Messi ‘La Vida Tropical’ which will be worn on-pitch exclusively by Leo and 10 of the World’s top young players.','adidas Launches All-New F50 Messi ‘La Vida Tropical’','adidas','S1',_binary 'data:image/jpeg;base64,','\n\nToday, adidas launches the new F50 Messi ‘La Vida Tropical’ which will be worn on-pitch exclusively by Leo and 10 of the World’s top young players.\n\nThe boot offers a fresh twist on last year’s F50 ‘Triunfo Estelar’ with some visual design updates such as the inclusion of a ‘Messi + 10’ sign-off in homage to the 10 young ballers who will also lace up in the new F50, including: Lamine Yamal, Cavan Sullivan, Claudio Echeverri, Jaedyn Shaw, Antonio Nusa, Joel Ndala, Vicky Lopez, Kenan Yildiz, Assan Ouedraogo, and Eliesse Ben Seghir.\n\nAnother update includes jagged haptic lines across the upper - versus the smooth lines seen on previous models - as a nod to the explosive speed associated with F50 players.  The boot also features the iconic ‘Messi’ logo on the heel counter and drops in a radiant pink and turquoise colourway inspired by the city of Miami. It includes the latest F50 technology, such as:\n\nSprintframe 360 - a specifically designed soleplate built to provide optimised stability and traction and help facilitate multidirectional speed and acceleration.\nHybridtouch Upper – a synthetic, lightweight material - that offers a moulded fit to provide comfort at high speeds, where it is needed most.\nBurrito Tongue closure system – The closure of the ‘burrito’ style tongue is adapted to Leo’s preferred fit and has been engineered with knit material for maximum comfort.\nThe boot will be worn on pitch for the first time be Leo on April 19th when Inter Miami take on Columbus Crew in the MLS and is available to purchase from today via https://www.adidas.co.uk/men-football-shoes and select adidas stores and retailers.\n\nENDS\n\nNOTES TO EDITORS:  \n\nAbout adidas \n\nadidas is a global leader in the sporting goods industry. Headquartered in Herzogenaurach/Germany, the company employs more than 62,000 people across the globe and generated sales of € 23.7 billion in 2024.\n\nFor more information, please visit www.adidas-Group.com. \n\nAbout adidas in Football   \n\nadidas is the global leader in football. It is the official supplier of the most important football tournaments in the world, such as the FIFA World Cup™, the FIFA Women’s World Cup™, the UEFA European Football Championship™, the UEFA Champions League™ & the UEFA Women’s Champions League™. adidas also sponsors some of the world’s top clubs including Real Madrid, Manchester United, Arsenal, FC Bayern Munich & Juventus. adidas is also partner to some of the best athletes in the game including Leo Messi, Lamine Yamal, Jude Bellingham, Aitana Bonmati, Pedri, Florian Wirtz, Alessia Russo, Paulo Dybala, Lena Oberdorf, Gabriel Jesus, Serge Gnabry, Manuel Neuer, Vivianne Miedema, Mary Fowler, and Wendie Renard','<p>Today, adidas launches the new F50 Messi ‘La Vida Tropical’ which will be worn on-pitch exclusively by Leo and 10 of the World’s top young players.</p>\n<p>The boot offers a fresh twist on last year’s F50 ‘Triunfo Estelar’ with some visual design updates such as the inclusion of a ‘Messi + 10’ sign-off in homage to the 10 young ballers who will also lace up in the new F50, including: Lamine Yamal, Cavan Sullivan, Claudio Echeverri, Jaedyn Shaw, Antonio Nusa, Joel Ndala, Vicky Lopez, Kenan Yildiz, Assan Ouedraogo, and Eliesse Ben Seghir.</p>\n<p>Another update includes jagged haptic lines across the upper - versus the smooth lines seen on previous models - as a nod to the explosive speed associated with F50 players.  The boot also features the iconic ‘Messi’ logo on the heel counter and drops in a radiant pink and turquoise colourway inspired by the city of Miami. It includes the latest F50 technology, such as:</p>\n<p>Sprintframe 360 - a specifically designed soleplate built to provide optimised stability and traction and help facilitate multidirectional speed and acceleration.\nHybridtouch Upper – a synthetic, lightweight material - that offers a moulded fit to provide comfort at high speeds, where it is needed most.\nBurrito Tongue closure system – The closure of the ‘burrito’ style tongue is adapted to Leo’s preferred fit and has been engineered with knit material for maximum comfort.\nThe boot will be worn on pitch for the first time be Leo on April 19th when Inter Miami take on Columbus Crew in the MLS and is available to purchase from today via https://www.adidas.co.uk/men-football-shoes and select adidas stores and retailers.</p>\n<p>ENDS</p>\n<p>NOTES TO EDITORS:</p>\n<p>About adidas</p>\n<p>adidas is a global leader in the sporting goods industry. Headquartered in Herzogenaurach/Germany, the company employs more than 62,000 people across the globe and generated sales of € 23.7 billion in 2024.</p>\n<p>For more information, please visit www.adidas-Group.com.</p>\n<p>About adidas in Football</p>\n<p>adidas is the global leader in football. It is the official supplier of the most important football tournaments in the world, such as the FIFA World Cup™, the FIFA Women’s World Cup™, the UEFA European Football Championship™, the UEFA Champions League™ &amp; the UEFA Women’s Champions League™. adidas also sponsors some of the world’s top clubs including Real Madrid, Manchester United, Arsenal, FC Bayern Munich &amp; Juventus. adidas is also partner to some of the best athletes in the game including Leo Messi, Lamine Yamal, Jude Bellingham, Aitana Bonmati, Pedri, Florian Wirtz, Alessia Russo, Paulo Dybala, Lena Oberdorf, Gabriel Jesus, Serge Gnabry, Manuel Neuer, Vivianne Miedema, Mary Fowler, and Wendie Renard</p>\n',27,0,'2025-05-28 09:06:29','2025-05-28 09:06:29');
INSERT INTO `blogs` VALUES (8,'\nNike Football is unveiling its 2025 national team kits, which bring forward the brand\'s pinnacle standard of performance apparel in striking designs that speak to the tradition, diversity and championship aspirations of each country and its athletes.','Nike\'s 2025 national team kits bring pinnacle performance and striking design to the pitch','nike','S1',_binary 'data:image/jpeg;base64,','Nike Football is unveiling its 2025 national team kits, which bring forward the brand\'s pinnacle standard of performance apparel in striking designs that speak to the tradition, diversity and championship aspirations of each country and its athletes.\n\nEach kit is made with the best of Nike\'s material innovation, Dri-FIT ADV, which moves sweat away from the skin for quicker evaporation—helping athletes stay cool, dry, comfortable and focused. \n\nDrawing on the dynamic movement of the women\'s game, Nike designers leveraged the latest advanced body-mapping technology, 4D data and state-of-the-art digital design tools to provide precise reinforcement, mobility, breathability and venting.\n\nIn creating the kits pixel by pixel, Nike designers used overlapping maps with rich data specific to women athletes to guide the placement of mesh and ribbed textures throughout the kits—delivering specific performance attributes, such as enhanced stretch or compression, exactly where it\'s needed most. This approach led to a new side panel, for example, enabling increased stretch, breathability and movement throughout the athlete\'s core. \n\nEach kit\'s federation crest is also made with Lite Flex technology that\'s intended to increase breathability while maintaining a lightweight design. \n\nIn addition to delivering performance that meets and exceeds athletes\' exact needs, Nike designers made sustainable considerations in creating every aspect of the new kits. \n\nThe Swooshes and trim on the kits are made entirely of Nike Grind: a collection of pre-consumer manufacturing scraps, recycled post-consumer shoes and unsellable footwear. Nike designers also boosted marker efficiency to 85% and leveraged state-of-the-art product creation technology to significantly reduce fabric waste in creating the kits.\n\nThe kits also bring to life the stories of each federation through vibrant designs that reflect the country\'s heritage, diversity and drive to win—all while celebrating women\'s football as an undeniable force that\'s elevating the game globally.\n\nMeanwhile, complementary National Federation Collections of Nike apparel, accessories and lifestyle products offer athletes and fans more ways to express their creativity, style and self-expression.\n\nNike\'s 2025 national team kits and collections will be available at Nike.com and select retail partners in the coming weeks. \n\nClick into the galleries below to learn more about the design inspirations for each kit.','<p>Nike Football is unveiling its 2025 national team kits, which bring forward the brand\'s pinnacle standard of performance apparel in striking designs that speak to the tradition, diversity and championship aspirations of each country and its athletes.</p>\n<p>Each kit is made with the best of Nike\'s material innovation, Dri-FIT ADV, which moves sweat away from the skin for quicker evaporation—helping athletes stay cool, dry, comfortable and focused.</p>\n<p>Drawing on the dynamic movement of the women\'s game, Nike designers leveraged the latest advanced body-mapping technology, 4D data and state-of-the-art digital design tools to provide precise reinforcement, mobility, breathability and venting.</p>\n<p>In creating the kits pixel by pixel, Nike designers used overlapping maps with rich data specific to women athletes to guide the placement of mesh and ribbed textures throughout the kits—delivering specific performance attributes, such as enhanced stretch or compression, exactly where it\'s needed most. This approach led to a new side panel, for example, enabling increased stretch, breathability and movement throughout the athlete\'s core.</p>\n<p>Each kit\'s federation crest is also made with Lite Flex technology that\'s intended to increase breathability while maintaining a lightweight design.</p>\n<p>In addition to delivering performance that meets and exceeds athletes\' exact needs, Nike designers made sustainable considerations in creating every aspect of the new kits.</p>\n<p>The Swooshes and trim on the kits are made entirely of Nike Grind: a collection of pre-consumer manufacturing scraps, recycled post-consumer shoes and unsellable footwear. Nike designers also boosted marker efficiency to 85% and leveraged state-of-the-art product creation technology to significantly reduce fabric waste in creating the kits.</p>\n<p>The kits also bring to life the stories of each federation through vibrant designs that reflect the country\'s heritage, diversity and drive to win—all while celebrating women\'s football as an undeniable force that\'s elevating the game globally.</p>\n<p>Meanwhile, complementary National Federation Collections of Nike apparel, accessories and lifestyle products offer athletes and fans more ways to express their creativity, style and self-expression.</p>\n<p>Nike\'s 2025 national team kits and collections will be available at Nike.com and select retail partners in the coming weeks.</p>\n<p>Click into the galleries below to learn more about the design inspirations for each kit.</p>\n',27,2,'2025-05-28 09:08:28','2025-05-28 09:09:46');
